import React, { Component } from "react";

class Game extends Component{
    
    showUnityGame()
    {
      console.log(this.props.aaa)
      if(this.props.aaa === "The Resume Game")
      {      
        return (<Unity unityContent={this.unityContent} />)
      }
      else
      {        
      }    
    }
    
    render(){
        return(
            <div>
                <script src="../theresume/Build/UnityLoader.js"></script>
                <script>
                    UnityLoader.instantiate("unityContainer", "../theresume/Build/Game.json");
                </script>

                {this.showUnityGame()}
            </div>
        )
    }
}

export default Game;
